import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Theme from './components/basics/theme.js'
import GlobalStyle from './components/basics/globalStyle.js'

ReactDOM.render(
  <React.StrictMode>
    <Theme>
      <GlobalStyle />
      <App />
    </Theme>
  </React.StrictMode>,
  document.getElementById('root')
);
